  input: TEXT,F3XA,,"The original report's receipts and disbursements were understated
    for several reasons.  First, a $70,928 receipt from the Democratic Congression
    Campaign Committee was originally listed as being received on the 17th of October,
    forcing the contribution to be reported on the 30 day Post-General.  After reviewing
    the records, it was determined that the check was actually received on the 16th
    of October - a one-day difference, but enough to shift the proper reporting of
    the contribution to the 12 day Pre-General. In addition, due to the size of the
    amount, a transfer from the Party's nonfederal account for the nonfederal portion
    of a joint-activity was made via check.  This caused the Party's software to catagorize
    the transfer as a disbursement by the state account instead of an H3 transfer
    to the federal account.  Upon running the Party's state report for the 4th quarter,
    the error was discovered, corrected, and the amended report was promptly filed.  The
    disbursements for the 12-day Pre-General were understated due to a large expenditure
    to Media Strategies & Research that was made via a bank wire and, subsequently,
    was coded as a bank wire on in our software.  However, our software did not associate
    bank wires with H4 disbursements and, therefore, failed to include the expenditure
    on the Schedule H4.  The discovery was made after a reconcilliation with the accounting
    software."
